import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';
import { Provider } from 'react-redux';

const app = <BrowserRouter>
    <App />
</BrowserRouter>
ReactDOM.render(app, document.getElementById('root'));
